			__gfirstSlidePlayButton = false;
			__playAudioButton();
		}; 
	}
	
	function loadAudio(sndName){ 
		__audio = document.getElementById("audio");  
		__audio.src = sndName;
		__audio.load();
	}
	
	function animationReady() { 
		console.log("not cleared-testing");
		refID = requestAnimationFrame(animationReady)
		if(__startAnimation && __preloadComplete){
			$(".waiting-holder").hide();
			__startAnimation = false;
			__preloadComplete = false;
			console.log("cleared-testing");
			cancelAnimationFrame(refID) 
			 playAnimationAudio()  
		} 
	}
	
	function playAnimationAudio(){
		var playPromise = __audio.play(); 
		if (playPromise !== undefined) {
		  playPromise.then(function() {   
				__audio.play();
				createjs.Ticker.removeEventListener("tick", stage);
				createjs.Ticker.addEventListener("tick", stage);
		  }).catch(function(error) {
				createjs.Ticker.removeEventListener("tick", stage);
		  });
		} 
	}  
</script>
</head>
<body style="margin:0px;">
	<div class="sld-holder" ng-controller="preloading" json="json/preload1.json">
		<!-- First slide play button for mobile or video--> 
		<div class="sld-play-audio" style="display:none;"></div>
		<!-- preload -->
		<div class="preloading-holder" ng-if="progress !== 100">
		<!-- <progress class="preloading-bar" value="{{progress}}" max="100">{{progress | number:0}}%</progress> -->
		<div class="preloading-circle">{{progress | number:0}}%</div>
		</div>
		<!-- preload end--> 
		<!-- slide content -->
		<div class="slide-content" ng-show="loaded">
			<div id="animation_container" style="width:1138px; height:570px">
				<canvas id="canvas" width="1138" height="570" style="position: absolute; display: block; "></canvas>
				<div id="dom_overlay_container" style="pointer-events:none; overflow:hidden; width:1138px; height:570px; position: absolute; left: 0px; top: 0px; display: block;">
				</div>
			</div>
		</div>
	</div>
</body>
</html>
